import React from "react";
class Coin extends React.Component{

    constructor(props){
        super(props)
        this.state = {
            coins : []
        }
        
    }
   
   async componentDidMount(){
        let headersList = {
            "Content-Type": "application/json",
            "Authorization": "Bearer "+localStorage.getItem('token'),
            "Access-Control-Allow-Origin": "http://localhost:8080"
           }

           
           const response = fetch("https://localhost:8089/api/coin/getAllCoin",{ 
             method: "GET",
             headers: headersList
           })
           console.log(response);
    }
    render(){
        return (
            <div> 
            <h1>Coin List</h1>
                <table className="table table-hover">
                    <thead>
                        <tr>
                            <th>CoinId</th>
                            <th>CoinName</th>
                            <th>Price</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                        this.state.coins.map(
                        coin =>
                        <tr key = {coin.coinId}>
                            <td>{coin.coinId}</td>
                            <td>{coin.coinName}</td>
                            <td>{coin.price}</td>
                        </tr>
                            )
                        }
                    </tbody>
            </table>
   </div>

        )
       
    }
}   

export default Coin;
